    {
    "name" : "valueset",
    "resource" : {
        "resourceType" : "ValueSet",
        "id" : "observation-interpretation",
        "meta" : {
          "lastUpdated" : "2019-11-01T09:29:23.356+11:00",
          "profile" : ["http://hl7.org/fhir/StructureDefinition/shareablevalueset"]
        },
        "text" : {
          "status" : "generated",
          "div" : "<div xmlns=\"http://www.w3.org/1999/xhtml\"><h2>Observation Interpretation Codes</h2><div><p>A categorical assessment, providing a rough qualitative interpretation of the observation value,    such as “normal”/ “abnormal”,”low” / “high”, “better” / “worse”, “susceptible” / “resistant”, “expected”/ “not expected”.    The value set is intended to be for ANY use where coded representation of an interpretation is needed.</p>\n<p>Notes:</p>\n<p>This is being communicated in v2.x in OBX-8 (Observation Interpretation), in v3 in ObservationInterpretation (CWE) in R1 (Representative Realm) and in FHIR in    Observation.interpretation. Historically these values come from the laboratory domain, and these codes are extensively    used. The value set binding is extensible, so codes outside the value set that are needed for interpretation concepts    (i.e. particular meanings) that are not included in the value set can be used, and these new codes may also be added to    the value set and published in a future version.</p>\n</div><p>This value set includes codes from the following code systems:</p><ul><li>Include all codes defined in <a href=\"v3/ObservationInterpretation/cs.html\"><code>http://terminology.hl7.org/CodeSystem/v3-ObservationInterpretation</code></a></li></ul></div>"
        },
        "extension" : [{
          "url" : "http://hl7.org/fhir/StructureDefinition/structuredefinition-wg",
          "valueCode" : "oo"
        },
        {
          "url" : "http://hl7.org/fhir/StructureDefinition/structuredefinition-standards-status",
          "valueCode" : "normative"
        },
        {
          "url" : "http://hl7.org/fhir/StructureDefinition/structuredefinition-normative-version",
          "valueCode" : "4.0.0"
        },
        {
          "url" : "http://hl7.org/fhir/StructureDefinition/structuredefinition-fmm",
          "valueInteger" : 5
        }],
        "url" : "http://hl7.org/fhir/ValueSet/observation-interpretation",
        "identifier" : [{
          "system" : "urn:ietf:rfc:3986",
          "value" : "urn:oid:2.16.840.1.113883.4.642.3.399"
        }],
        "version" : "4.0.1",
        "name" : "ObservationInterpretationCodes",
        "title" : "Observation Interpretation Codes",
        "status" : "active",
        "experimental" : false,
        "date" : "2019-11-01T09:29:23+11:00",
        "publisher" : "FHIR Project team",
        "contact" : [{
          "telecom" : [{
            "system" : "url",
            "value" : "http://hl7.org/fhir"
          }]
        }],
        "description" : "A categorical assessment, providing a rough qualitative interpretation of the observation value,    such as “normal”/ “abnormal”,”low” / “high”, “better” / “worse”, “susceptible” / “resistant”, “expected”/ “not expected”.    The value set is intended to be for ANY use where coded representation of an interpretation is needed.   \r\n   \r\n   Notes:\r\n   \r\n   This is being communicated in v2.x in OBX-8 (Observation Interpretation), in v3 in ObservationInterpretation (CWE) in R1 (Representative Realm) and in FHIR in    Observation.interpretation. Historically these values come from the laboratory domain, and these codes are extensively    used. The value set binding is extensible, so codes outside the value set that are needed for interpretation concepts    (i.e. particular meanings) that are not included in the value set can be used, and these new codes may also be added to    the value set and published in a future version.",
        "compose" : {
          "include" : [{
            "system" : "http://terminology.hl7.org/CodeSystem/v3-ObservationInterpretation"
          }]
        }
      }
    },
    {
      "name" : "code",
      "valueString" : "ObservationInterpretationDetection"
    },
    {
    "name" : "displayLanguage",
    "valueString" : "english"
    }
  ]
}

